import React from 'react';
import Layout from '../components/Layout'; 
function NotFound() {
  return (
    <Layout>
      <h1>404 - Page Not Found</h1>
      <p>Sorry, the page you are looking for does not exist.</p>
    </Layout>
  );
}
// Correct export
export default NotFound;
